import React from 'react';

export default function Login() {
    return (
        <div className="page">
            <div className="titleWrap">로그인</div>

            <div className="contentWrap">
                <div className="inputWrap">
                    <input className="input" />
                </div>
            </div>
        </div> // 코드 작성 시 삭제해주세요!
    );
}
